import { Component } from "react";
const styles = {
    logo: {
        width:'300px',
    }
}

class Logo extends Component{
    render() {
        return (
            <img style={styles.logo } src="/img/logo.png" alt="Logo de herencia la galicia" /> 
        )
    }
}
export default Logo
